import React, { Component } from 'react';
class Home extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() {
        return (
            <img 
            src="BCHousing.jpg"
            alt="new"
            />

        );
    }
}

export default Home;
